    <div>
      <h1 className='title'>My Leaflet.js and React Map</h1>
      <div>
        <Button className='thisButton'>This is a Button</Button>
      </div>

      <div>
        <LeafletMap/>
      </div>
    </div>
  );
}
export default App;
